import React from "react";
import {
  Text,
  View,
  StyleSheet,
  SafeAreaView,
  TouchableOpacity,
  Button,
} from "react-native";

export const TypeSignup = ({ navigation }) => {
  const [data, setData] = React.useState({
    role: "",
  });

  return (
    <View style={styles.container1}>
      <TouchableOpacity
        style={styles.buttoncontainer1}
        onPress={() =>
          navigation.navigate("SignupUser", {
            role: "pet owner",
          })
        }
      >
        <Text style={styles.buttontext1}>Signup as user</Text>
      </TouchableOpacity>
      <TouchableOpacity
        style={styles.buttoncontainer1}
        onPress={() =>
          navigation.navigate("SP1", {
            role: "service provider",
          })
        }
      >
        <Text style={styles.buttontext1}>Signup as service provider</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container1: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    paddingBottom: 50,
    backgroundColor: "white",
  },
  input1: {
    flexDirection: "row",
  },
  inputtext1: {
    borderRadius: 9,
    width: 300,
    height: 40,
    borderColor: "#ff00ff",
    borderWidth: 1,
    paddingHorizontal: 35,
    fontSize: 15,
    color: "black",
    marginVertical: 10,
  },
  icon1: {
    position: "absolute",
    top: 18,
    left: 5,
  },
  buttoncontainer1: {
    borderRadius: 15,
    width: 300,
    height: 45,
    backgroundColor: "#ff00ff",
    paddingTop: 1,
    justifyContent: "center",
    marginTop: 30,
    paddingLeft: 60,
  },
  buttontext1: {
    textAlign: "center",
    color: "black",
    fontSize: 20,
    right: 30,
  },
});
